import React from 'react'
import LoginPage from "../MyComponents/LoginPage";


function Home() {


  return (
    <>
    {/* Code of Banner */}
    <div className='Banner'>
        <div className='Banner-details'>

        <p>Co-Op Housing Society Management System</p>
        </div>
    </div>

    
    <LoginPage/>
    

    </>
  )
}

export default Home
